import{_ as e,c as a,o as r,A as t}from"./app.d76c4e42.js";const g=JSON.parse('{"title":"手动拼接长url，引发的血案","description":"","frontmatter":{"title":"手动拼接长url，引发的血案","author":"Potter","date":"2022-05-12 18:32","tags":["编程血案"],"categories":["编程血案"]},"headers":[{"level":2,"title":"问题描述","slug":"问题描述","link":"#问题描述","children":[]},{"level":2,"title":"问题思考","slug":"问题思考","link":"#问题思考","children":[]},{"level":2,"title":"断定理由：","slug":"断定理由","link":"#断定理由","children":[]},{"level":2,"title":"具体原因","slug":"具体原因","link":"#具体原因","children":[]},{"level":2,"title":"解决办法","slug":"解决办法","link":"#解决办法","children":[]},{"level":2,"title":"总结","slug":"总结","link":"#总结","children":[]}],"relativePath":"article/06-misc/tragedy/手动拼接长url，引发的血案.md","lastUpdated":1685438549000}'),l={name:"article/06-misc/tragedy/手动拼接长url，引发的血案.md"},i=t('<h1 id="手动拼接长url-引发的血案" tabindex="-1">手动拼接长url，引发的血案 <a class="header-anchor" href="#手动拼接长url-引发的血案" aria-hidden="true">#</a></h1><h2 id="问题描述" tabindex="-1">问题描述 <a class="header-anchor" href="#问题描述" aria-hidden="true">#</a></h2><p>小程序内嵌 webview 网站显示不正常，单独把网站地址放置浏览器正常工作</p><h2 id="问题思考" tabindex="-1">问题思考 <a class="header-anchor" href="#问题思考" aria-hidden="true">#</a></h2><p>肯定是网站的地址参数问题</p><h2 id="断定理由" tabindex="-1">断定理由： <a class="header-anchor" href="#断定理由" aria-hidden="true">#</a></h2><ul><li>理由 1：网站是可以打开，只是显示不正确</li><li>理由 2：相同地址不同参数，一个现实正常一个现实不正常</li></ul><p>把问题的原因告诉做内嵌网站的那个同事 A 了，结果找到一天都没有找到原因。他跟另外一个同事说：可能是我升级环境导致的问题，由 vue2 升级到 vue3 导致（无语，完全跟这无关啊）</p><p>根据与另外一个 B 同事的尝试，最后发现的问题，地址多了一个换行符导致。（额，哪里会多拼一个换行符出来了，直接调试定位到以下代码）</p><h2 id="具体原因" tabindex="-1">具体原因 <a class="header-anchor" href="#具体原因" aria-hidden="true">#</a></h2><p><img src="https://cdn.jsdelivr.net/gh/yxw007/BlogPicBed@master//img/20220512182400.png" alt=""></p><p>vscode 安装 prettier，自动格式化后把超过长度限制的拼接地址加了换行。</p><h2 id="解决办法" tabindex="-1">解决办法 <a class="header-anchor" href="#解决办法" aria-hidden="true">#</a></h2><p><img src="https://cdn.jsdelivr.net/gh/yxw007/BlogPicBed@master//img/20220512182342.png" alt=""></p><h2 id="总结" tabindex="-1">总结 <a class="header-anchor" href="#总结" aria-hidden="true">#</a></h2><ul><li>切忌：不要纯手工手动拼接 url，直接将 url 参数转成对象，然后根据对象生成 url 参数（这也是以前的同事为了偷懒导致的问题）</li></ul>',16),d=[i];function h(n,s,c,_,u,o){return r(),a("div",null,d)}const m=e(l,[["render",h]]);export{g as __pageData,m as default};
